import axios from "axios";

const VIEWALL_PEMINJAMAN_URL = `${API_URL}/peminjaman/viewall`

class PeminjamanListService {
	getAllPeminjaman() {
		return axios.get(`${VIEWALL_PEMINJAMAN_URL}`)
	}
}

export default new PeminjamanListService()
